import React from 'react'
import './others.css'
import { CiFolderOn } from 'react-icons/ci'
import { RiGithubLine } from 'react-icons/ri'
import { FiExternalLink } from 'react-icons/fi'

import AOS from 'aos'
import 'aos/dist/aos.css'
import { useEffect } from 'react'
  useEffect(() => {
    AOS.init({duration:2000})
  }, []);

const data = [
  {
    github: '#',
    demo: '#',
    title: 'Sample Title One',
    preview: 'Lorem ipsum dolor sit amet consectetur adipisicing elit. Expedita natus doloribus reiciendis pariatur aperiam? Earum.',
    tech: [ 'HTML5', 'CSS3', 'Bootstrap5',  'React', 'WebAPI']
  },
  {
    github: '#',
    demo: '#',
    title: 'Sample Title Two',
    preview: 'Lorem ipsum dolor sit, amet consectetur adipisicing elit. Aut, quisquam?',
    tech: [ 'HTML5', 'CSS3',  'React', 'WebAPI']
  },
  {
    github: '#',
    demo: '#',
    title: 'Sample Title Three',
    preview: 'Lorem ipsum dolor sit amet consectetur adipisicing elit. Sapiente nemo quam reprehenderit fugit dolores veniam, sunt totam optio ullam aliquid.',
    tech: [ 'HTML5', 'CSS3', 'Bootstrap5',  'React']
  },
  {
    github: '#',
    demo: '#',
    title: 'Sample Title Four',
    preview: 'Lorem ipsum dolor sit amet consectetur adipisicing elit. Sapiente nemo quam reprehenderit fugit dolores veniam, sunt totam optio ullam aliquid sunt totam optio ullam.',
    tech: [ 'HTML5', 'CSS3', 'Bootstrap5', 'React', 'RestAPI']
  },
  {
    github: '#',
    demo: '#',
    title: 'Sample Title Five',
    preview: 'Lorem ipsum dolor sit amet consectetur adipisicing elit. Sapiente nemo quam reprehenderit fugit dolores veniam, sunt totam optio ullam.',
    tech: [ 'HTML5', 'CSS3', 'Bootstrap5', 'RestAPI']
  },
  {
    github: '#',
    demo: '#',
    title: 'Sample Title Six',
    preview: 'Lorem ipsum dolor sit amet consectetur adipisicing elit. Sapiente nemo quam reprehenderit fugit dolores veniam, sunt totam optio ullam.',
    tech: [ 'HTML5', 'CSS3', 'Bootstrap5', 'RestAPI']
  }
]

const Others = () => {
  return (
    <section id='others'>
      <h2>Other Projects</h2>
      <div className="container others__container">
      {
        data.map( ({github, demo, title, preview, tech}, index ) => {
          return (
            <div key={index} className="other__container">
              <ul className='other__head'>
                <li><CiFolderOn className='other__head-icon'/></li>
                <li className='other__head-links'>
                  <a href={github}><RiGithubLine /></a>
                  <a href={demo}><FiExternalLink /></a>
                </li>
              </ul>
              <article className='other__details'>
                <a href="#">
                  <h3>{title}</h3>
                </a>
                <p>{preview}</p>
              </article>
              <ul className='other__tech'>
              {
                tech.map( (item, index) => {
                  return (
                    <li key={index}>{item}</li>
                  )
              })
              }
              </ul>
            </div> 
          )
        })
        }
      </div>
    </section>
  )
}

export default Others
